import axios from 'axios';



export default class Scrape extends React.Component {

    state={imgVdData:[null]}

    componentDidMount() {


        (async () => {
            try {
              const response = await axios.get(`http://localhost:3000/scrape`,{headers: {'Authorization': `Basic dGVzdDp0ZXN0MTIz`}});
              console.log(response);
              this.setState({ imgVdData: response});
            } catch (error) {
              console.error(error);
              this.setState({ imgVdData:error });
            }
          });
        }

